import { createSlice } from '@reduxjs/toolkit'
export const Prodact=createSlice({
    initialState:[{id:1,title:"Asas"}],
    name:"prodact",
    reducers:{
        Addprodact:(state,action)=>{
            return state.push(action.payload)
        },
        // getAllproadct:(state,action)=>{
        //     return state.push(action.payload)

        
    }
})
export const {Addprodact}=Prodact.actions
export default Prodact.reducers
